  const begin = () =>{
    setIsBeginning(false);
    setIsSettingTeam(true);
  };
  const test = () => {
    console.log(this.arrEquipe);
  }

  return (
    <div>
      <h1>Word Quest!!</h1>
      {isBeginning && (<Intro begin={()=>begin()}/> )}
      {isSettingTeam && (<FormerEquipe/> )}
      <button onClick={()=>test()}>test</button>
